import MatchLine from "./MatchLine";

function MatchesCont(props) {
    return (
        <>
            <div className="flex flex-col gap-2">
                <div className="flex gap-5 items-center basis-6/12 justify-between">
                    <div className="flex gap-3">
                        <img className="h-8 w-8 object-contain" src={props.leagueIcon} alt="leagueIcon" />
                        <div className="text-xl font-medium leading-normal">{props.leagueTitle}</div> 
                    </div>
                    <div>
                    {props.ended ? (
                        <span className="bg-red-100 text-red-800 text-xs font-medium px-2.5 py-0.5 rounded border border-red-400">
                            Ended
                        </span>
                        ) : (
                        <div className="flex gap-3">
                        <span className="bg-lime-100 text-lime-800 text-xs font-medium px-2.5 py-0.5 rounded border border-lime-400">Active</span>
                        <span className="bg-lime-100 text-lime-800 text-xs font-medium px-2.5 py-0.5 rounded border border-lime-400">Matchday </span>
                        </div>
                    )}
                    </div>
                </div>
                <MatchLine />
                <MatchLine />
                <MatchLine />
            </div>
        </>
    );
}

export default MatchesCont;
